import React from 'react';
import styled from 'styled-components';
import { motion } from 'framer-motion';
import { FaHeadset, FaRobot, FaLightbulb } from 'react-icons/fa';
import ThemeToggle from './ThemeToggle';
import { useTheme } from '../ThemeContext';

const HeaderContainer = styled(motion.header)`
  background: ${({ themeMode }) => 
    themeMode === 'light' 
      ? 'rgba(255, 255, 255, 0.95)' 
      : 'rgba(15, 15, 15, 0.95)'};
  backdrop-filter: blur(20px);
  border-bottom: ${({ themeMode }) => 
    themeMode === 'light' 
      ? '1px solid rgba(148, 163, 184, 0.3)' 
      : '1px solid rgba(255, 255, 255, 0.1)'};
  padding: 1.5rem 2rem;
  position: sticky;
  top: 0;
  z-index: 100;
  box-shadow: ${({ themeMode }) => 
    themeMode === 'light' 
      ? '0 4px 16px rgba(0, 0, 0, 0.08)' 
      : '0 8px 32px rgba(0, 0, 0, 0.3)'};
  transition: all 0.4s cubic-bezier(0.4,0,0.2,1);
  border-radius: 0 0 24px 24px;
  margin: 0 0 2rem 0;
  
  &::before {
    content: '';
    position: absolute;
    top: 0;
    left: 0;
    right: 0;
    bottom: 0;
    background: ${({ themeMode }) => 
      themeMode === 'light' 
        ? 'linear-gradient(135deg, rgba(59, 130, 246, 0.05), rgba(29, 78, 216, 0.02))' 
        : 'linear-gradient(135deg, rgba(99, 102, 241, 0.1), rgba(139, 92, 246, 0.05))'};
    border-radius: 0 0 24px 24px;
    pointer-events: none;
  }
`;

const HeaderContent = styled.div`
  max-width: 1200px;
  margin: 0 auto;
  display: flex;
  align-items: center;
  justify-content: space-between;
  gap: 2rem;
  position: relative;
  z-index: 1;
  
  @media (max-width: 768px) {
    flex-direction: column;
    gap: 1rem;
    text-align: center;
  }
`;

const LeftSection = styled.div`
  display: flex;
  align-items: center;
  gap: 0.75rem;
`;

const CenterSection = styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
  gap: 1.5rem;
  flex: 1;
  
  @media (max-width: 768px) {
    order: 2;
  }
`;

const RightSection = styled.div`
  display: flex;
  align-items: center;
  justify-content: flex-end;
  min-width: 100px;
  
  @media (max-width: 768px) {
    order: 3;
    justify-content: center;
  }
`;

const Logo = styled(LeftSection)`
  gap: 0.75rem;
  
  @media (max-width: 768px) {
    order: 1;
  }
`;

const LogoIcon = styled(motion.div)`
  width: 40px;
  height: 40px;
  background: ${({ themeMode }) => 
    themeMode === 'light' 
      ? 'linear-gradient(135deg, #3b82f6, #1d4ed8)' 
      : 'linear-gradient(135deg, #6366f1, #8b5cf6)'};
  border-radius: 12px;
  display: flex;
  align-items: center;
  justify-content: center;
  box-shadow: ${({ themeMode }) => 
    themeMode === 'light' 
      ? '0 2px 8px rgba(59, 130, 246, 0.3)' 
      : '0 4px 20px rgba(99, 102, 241, 0.3)'};
  transition: all 0.4s cubic-bezier(0.4,0,0.2,1);
  
  svg {
    color: white;
    font-size: 1.2rem;
  }
`;

const LogoText = styled.div`
  h1 {
    font-size: 1.6rem;
    font-weight: 800;
    background: ${({ themeMode }) => 
      themeMode === 'light' 
        ? 'linear-gradient(135deg, #3b82f6, #1d4ed8)' 
        : 'linear-gradient(135deg, #60a5fa, #a78bfa)'};
    -webkit-background-clip: text;
    -webkit-text-fill-color: transparent;
    background-clip: text;
    margin: 0;
    line-height: 1;
    transition: all 0.4s cubic-bezier(0.4,0,0.2,1);
  }
  
  p {
    font-size: 0.75rem;
    color: ${({ themeMode }) => 
      themeMode === 'light' 
        ? 'rgba(71, 85, 105, 0.7)' 
        : 'rgba(255, 255, 255, 0.6)'};
    margin: 0;
    font-weight: 500;
    letter-spacing: 0.5px;
    text-transform: uppercase;
    margin-top: 2px;
    transition: all 0.4s cubic-bezier(0.4,0,0.2,1);
  }
`;

const StatusIndicators = styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
  gap: 1.5rem;
  
  @media (max-width: 768px) {
    flex-wrap: wrap;
    justify-content: center;
  }
`;

const ThemeToggleWrapper = styled.div`
  display: flex;
  justify-content: flex-end;
  align-items: center;
  
  @media (max-width: 768px) {
    justify-content: center;
  }
`;

const StatusItem = styled(motion.div)`
  display: flex;
  align-items: center;
  gap: 0.5rem;
  padding: 0.5rem 1rem;
  background: ${({ themeMode }) => 
    themeMode === 'light' 
      ? 'rgba(59, 130, 246, 0.05)' 
      : 'rgba(255, 255, 255, 0.05)'};
  border: ${({ themeMode }) => 
    themeMode === 'light' 
      ? '1px solid rgba(59, 130, 246, 0.15)' 
      : '1px solid rgba(255, 255, 255, 0.1)'};
  border-radius: 20px;
  font-size: 0.85rem;
  color: ${({ themeMode }) => 
    themeMode === 'light' 
      ? 'rgba(71, 85, 105, 0.8)' 
      : 'rgba(255, 255, 255, 0.8)'};
  font-weight: 500;
  transition: all 0.3s ease;
  
  &:hover {
    background: ${({ themeMode }) => 
      themeMode === 'light' 
        ? 'rgba(59, 130, 246, 0.1)' 
        : 'rgba(255, 255, 255, 0.1)'};
    border-color: ${({ themeMode }) => 
      themeMode === 'light' 
        ? 'rgba(59, 130, 246, 0.25)' 
        : 'rgba(255, 255, 255, 0.2)'};
    color: ${({ themeMode }) => 
      themeMode === 'light' 
        ? 'rgba(30, 41, 59, 1)' 
        : 'white'};
    transform: translateY(-1px);
    box-shadow: ${({ themeMode }) => 
      themeMode === 'light' 
        ? '0 2px 8px rgba(59, 130, 246, 0.2)' 
        : '0 4px 12px rgba(0, 0, 0, 0.3)'};
  }
  
  svg {
    color: ${({ themeMode }) => 
      themeMode === 'light' 
        ? '#3b82f6' 
        : '#60a5fa'};
    font-size: 0.9rem;
  }
`;

const StatusDot = styled.div`
  width: 8px;
  height: 8px;
  border-radius: 50%;
  background: ${props => props.status === 'online' ? '#10b981' : '#ef4444'};
  box-shadow: 0 0 8px ${props => props.status === 'online' ? '#10b981' : '#ef4444'};
`;

function Header() {
  const { theme } = useTheme();
  
  return (
    <HeaderContainer
      themeMode={theme}
      initial={{ y: -100, opacity: 0 }}
      animate={{ y: 0, opacity: 1 }}
      transition={{ duration: 0.6, ease: "easeOut" }}
    >
      <HeaderContent>
        <Logo>
          <LogoIcon
            themeMode={theme}
            whileHover={{ scale: 1.1, rotate: 5 }}
            whileTap={{ scale: 0.95 }}
          >
            <FaHeadset />
          </LogoIcon>
          <LogoText themeMode={theme}>
            <h1>TriageAI</h1>
            <p>AI-Powered Support</p>
          </LogoText>
        </Logo>
        
        <StatusIndicators>
          <StatusItem
            themeMode={theme}
            initial={{ opacity: 0, x: 20 }}
            animate={{ opacity: 1, x: 0 }}
            transition={{ delay: 0.2 }}
          >
            <FaRobot />
            <StatusDot status="online" />
            AI Online
          </StatusItem>
          
          <StatusItem
            themeMode={theme}
            initial={{ opacity: 0, x: 20 }}
            animate={{ opacity: 1, x: 0 }}
            transition={{ delay: 0.3 }}
          >
            <FaLightbulb />
            <StatusDot status="online" />
            Smart Search
          </StatusItem>
        </StatusIndicators>
        
        <ThemeToggleWrapper>
          <ThemeToggle />
        </ThemeToggleWrapper>
      </HeaderContent>
    </HeaderContainer>
  );
}

export default Header;
